function kexam__install() {
	global $wpdb;
	global $kexam_jal_db_version;
	
 

	$table_name = $wpdb->prefix . 'exercise';
	
	$charset_collate = $wpdb->get_charset_collate();

	$sql = "CREATE TABLE $table_name (
		id mediumint(9) NOT NULL AUTO_INCREMENT,
	   exercise_id int(10) NOT NULL,
  exercise_title varchar(500) NOT NULL,
  question_no int(10) NOT NULL,
  answer_no int(100) NOT NULL,
  question varchar(500) NOT NULL,
  a1 varchar(500) NOT NULL,
  a2 varchar(500) NOT NULL,
  a3 varchar(500) NOT NULL,
  a4 varchar(500) NOT NULL,
  a5 varchar(500) NOT NULL,
  answer varchar(500) NOT NULL,
  answer_detail varchar(500) NOT NULL,
  author varchar(500) NOT NULL,
  datantime timestamp NOT NULL DEFAULT current_timestamp(),
  answer_topic varchar(1000) NOT NULL,
		PRIMARY KEY  (id)
	) $charset_collate;";

	require_once( ABSPATH . 'wp-admin/includes/upgrade.php' );
	dbDelta( $sql );

	add_option( 'jal_db_version', $jal_db_version );
	
	
		 

}

