(2960, 60, 'Advanced level # 60', 7, 7, 'At lunch time he went to his sister\'s house to see his wife and daughters. They had spent the morning\r\n	addressing envelopes for the leaflets he was sending out. His sister, Vera, thoroughly ....... of his involvement\r\n	in politics.', 'disliked', 'discouraged', 'disappointed', 'disapproved', '', 'disapproved', 'At lunch time he went to his sister\'s house to see his wife and daughters. They had spent the morning addressing envelopes for the leaflets he was sending out. His sister, Vera, thoroughly disapproved of his involvement in politics.', '', '2020-07-06 08:22:12', 'Advanced level # 60'),
