(2962, 60, 'Advanced level # 60', 9, 9, 'There was a large crowd in the field when Henry arrived at eight o\'clock for what was perhaps the biggest\r\n	meeting of the ....... campaign. After a hard day\'s work, hundreds of farmers and farm labourers had come to\r\n	the field to hear what Henry had to say.', 'utter', 'whole', 'absolute', 'lasting', '', 'whole', 'There was a large crowd in the field when Henry arrived at eight o\'clock for what was perhaps the biggest meeting of the whole campaign. After a hard day\'s work, hundreds of farmers and farm labourers had come to the field to hear what Henry had to say.', '', '2020-07-06 08:22:12', 'Advanced level # 60'),
(2963, 60, 'Advanced level # 60', 10, 10, 'Henry: Ladies and gentlemen, I appreciate the anxiety you must all feel about support for your farms. I too\r\n	have been a farmer and I know the difficulties you are experiencing, and so...					\r\n	Voice from the crowd: ... and so you\'ve decided to become an M.P. and get rich!					\r\n	Henry: No, my friend. I want to give the farmers a ....... in the House of Commons.', 'sound', 'speech', 'noise', 'voice', '', 'voice', 'Henry: Ladies and gentlemen, I appreciate the anxiety you must all feel about support for your farms. I toohave been a farmer and I know the difficulties you are experiencing, and so...Voice from the crowd: ... and so you\'ve decided to become an M.P. and get rich!Henry: No, my friend. I want to give the farmers a voice in the House of Commons.', '', '2020-07-06 08:22:12', 'Advanced level # 60'),
