(2966, 61, 'Advanced level # 61', 3, 3, '\'Well, we can\'t sell them at a profit,\' said the tractor driver, \'because the imported ones are too cheap. So instead of letting them	go\r\n	to ......., you can have them!\'', 'loss', 'disaster', 'waste', 'rubbish', '', 'waste', '\'Well, we can\'t sell them at a profit,\' said the tractor driver, \'because the imported ones are too cheap. So instead of letting them go to waste, you can have them!\'', '', '2020-07-06 08:22:12', 'Advanced level # 61'),
